'The Red Medley' comes the day after the 2013 CMT Awards. On June 5th 2013, Taylor knocked 'em sure enough dead with 'Red' wrapped in red flags. And those dead rose not in three days but one to quick come see Taylor kill 'em again that very next night, D-Day 2013.


This reading of 'Red' provides one of my two favorite moments of top pop celebration in 2013. 

The other happened but 2 days later @ (as noted &amp; posted par moi pour vous here before) : &quot;Taylor Swift - 2013-06-08, Britain's Got Talent - ft. Ed Sheeran - HDTV MKV - Everything Has Changed&quot;


Now dig this here Red-on bliss:

At 01:33 comes the preview, our cue, when Taylor sings &quot;love could be that strong,&quot; she turns stage left and faces straight into the camera. Reaches right into us. And there's our cue.

Following a brief shot from another camera behind the crowd, the hand-held stage-left lens begins a single long shot... 

The camera moves right toward center stage and then revolves around her. 
Not once, not twice, but thrice is nice. 

The first time round her, Taylor is singing while facing the crowd in front. But still she raises her upper eyelids and lip 
in a winning lady grinning soul move to let us know she's letting us in 
as we go by smiling sweetly back at her. 

As the camera comes round her back and to her left side, Taylor looks straight into the lens and heads deep into our heart, with a sexy look like, 'come hither baby, and now git off on me.' 

Our head is floating as camera keeps going round, like the earth around the sun, till suddenly it is, yes it's red-headbanging time! (Again.) 

'Head...bang...er!' 

Taylor throws her head and her hair back and forward and up and down and back again like she is tossing down a strong one and tossing off another lover.

But we are not going anywhere but in orbit of her heavenly rocking presence.

'Loving him was red,' but our loving her in black shorts and white legs is lit up, as bright as Juliet is the sun, for here she is, for her yellow is not so mellow, but a belle ringing a bell, and yelling loud and clearly lovely, a blonde on bombshell going off everywhere in her hair there we are lost and found.

The camera comes round her for the third and final time, only to veer off and withdraw stage left, to leave Taylor alone and us stunned by her wildfire away! 

_______________________________________________________________


Love may be like driving a new Maserati down a dead-end street, 
or even like an old Mazda Miata up around the bend, 
but either way you just know this girl and this here guy will still go there.

Come on the rising wind-win.

We're goin down the highway...

_______________________________


&quot;Highway Don't Care&quot; is a song performed by American country music artist Tim McGraw and features American country pop artist Taylor Swift-Footed Achilles Last Stand on vocals. It was released in March 2013 as the third single from McGraw's first album for Big Machine Records, 'Two Lanes of Freedom.' Keith Urban plays guitar on the song. McGraw and Swift recorded their parts separately. 

...Consciously uncoupled and unbuckled but still bucking consciousness...

- 'Highway don't care.' 
- If I would will you do it my way?
- 'I can't live without ya, baby.' 
- Right back at ya, honey.

__________________________


This is so far one of the absolute ultimate Swift with-an-arrow-to-my-heart's-head performances... 

Well, Taylor is a headbanger! 

Taylor Killing Me Swiftly With Her Song

...May you drop dead gorgeous from her, too.
